속에, 홀로 뉴욕행 비행기에 오르게 되어 거대한 도시에 혼자 남게 된 케빈. 겁도 났지만, 한편으로 신나기도 하다. 이때 마브와 해리는 감옥을 탈출하여 한탕할 꿈에 부풀어 있다. 한편 케빈은 기지를 발휘하여 아버지 카드로 플로리자 호텔에 부숙, 의심스러워 하는 종업원들을 멋지게 따돌린다. 케빈은 덩컨 장난감 가게에서 만난 덩컨씨에게서 뜻 깊은 계획을 듣고 작은 기부금을 내미는데 그 보답으로 작은 비둘기 두 개를 선물받는다. 덩컨씨는 크리스마스때 번 돈을 어린이 병원에 기부하려하고 있다. 그러나 공교롭게 마브와 해리가 이 기부금을 노리고 있을 줄이야. 케빈은 덩컨가게 앞에서 마브와 해리를 만나 쫓기게 되고, 설상가상으로 케빈의 카드를 추적한 호텔직원의 저지를 받는다. 궁지에 몰린 케빈은 결국 마브와 해리에게 잡히게 되는데 이때 그들의 계획을 알게된다. 간신히 도망쳐 나간 케빈은 우연히 공원에서 비둘기 아줌마를 만나 친구가 된다. 그녀와의 대화에서 가족의 소중함을 깨달은 그는 자신의 잘못을 뉘우치는 의미에서 착한 일을 하겠다고 다짐한다. \'불쌍한 어린이들의 돈을 뺏어가게 둘 순 없지\' 케빈은 삼촌의 빈집을 이용하여 마브와 해리를 저지시킬 준비에 들어가는데...','https://an2-img.amz.wtchn.net/image/v2/JH2LYox51LCNdLybNlr0aA.jpg?jwt=ZXlKaGJHY2lPaUpJVXpJMU5pSjkuZXlKdmNIUnpJanBiSW1SZk5qUXdlRE0yTUhFNE1DSmRMQ0p3SWpvaUwzWXhMMmwxZG5Ock5HTjJPV3hpWkc5aGNtMXFaWEp6SW4wLkRkSDNmYVE4eS0tdWlXLVU4dnNhbFNRZXViN1BZZFg4Zm1CcTlOaXZfUTQ|https://an2-img.amz.wtchn.net/image/v2/TU9VakSRs_SNR9q3Ip6Fuw.jpg?jwt=ZXlKaGJHY2lPaUpJVXpJMU5pSjkuZXlKdmNIUnpJanBiSW1SZk5qUXdlRE0yTUhFNE1DSmRMQ0p3SWpvaUwzWXhMMjF1TVRKbmNTMHhOak00TXlKOS5FVDhLSFhzVWhTTk1CamM1ZmFVNGZRWm1Oamo0M19XN1hYdnY2dEVfdTN3|https://an2-img.amz.wtchn.net/image/v2/whUbUb5QmHsSjCcNrmiYXg.jpg?jwt=ZXlKaGJHY2lPaUpJVXpJMU5pSjkuZXlKdmNIUnpJanBiSW1SZk5qUXdlRE0yTUhFNE1DSmRMQ0p3SWpvaUwzWXhMMmx5YW1nNGRuZDVaR1ZyWW5nNGJuVmtlblZwSW4wLm5xSlpINVE5UkR0ZkpyZlRZekVXbVZubk40NUl3Sno2bW9yNXRmdU1hVzg|https://an2-img.amz.wtchn.net/image/v2/EWQPmReyJNRamcKLdLRYKA.jpg?jwt=ZXlKaGJHY2lPaUpJVXpJMU5pSjkuZXlKdmNIUnpJanBiSW1SZk5qUXdlRE0yTUhFNE1DSmRMQ0p3SWpvaUwzWXhMMmxtWjJaMloyZDRNbTFxWkRsbWRtNTNkMk53SW4wLk9WejJaTm5rQmE3S2RmMUtSZEl3Qm1SOWlBUjZESWZHbGo4cU5OT2FVZ0U','https://www.youtube.com/watch?v=vIRoNlPZeqk','https://www.disneyplus.com/ko-kr/movies/home-alone-2-lost-in-new-york/3gjRdWD3Yks3?irclickid=0uoRNOWDGxyNTMVVwaUXBVHEUkA3pwRZ5WOly40&irgwc=1&cid=DSS-Affiliate-Impact--WATCHA-1182069&tgclid=0201003d-a74a-4248-8800-051b63e2379c&dclid=CjgKEAiAioifBhCBxdnXlbLXxicSJADeubDclZOSUDFU16wRil0C-f_edLerD8UsNXRdKU-U0Lzcm_D_BwE','https://an2-i